import React from 'react';
import '../../App.css';

export default function Signup() {
  return (
    <div className='signup'>
      <video autoPlay loop muted className='video-background'>
        <source src='/videos/video6.mp4' type='video/mp4' />
      </video>
      <h1>Sign up</h1>

    </div>
  );
}
